import React from "react";
import "./MainPageComponent.css";
import { FaBeer } from "react-icons/fa";
import logo from "../logo_transp.png";
import {
  BsBell,
  BsFillPersonFill,
  BsPersonCircle,
  BsChatFill,
  BsSearch,
} from "react-icons/bs";

class MainPageComponent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      greeting: "Hello!",
    };
  }

  componentDidMount() {}

  render() {
    return (
      <div id="main_page_all">
        <body id="main_page_body">
          <nav>
            <div className="nav-left">
              <img src={logo} id="logo_nav" />
              <h></h>
              <ul>
                <li>
                  <BsBell color="white" />{" "}
                </li>
                <li>
                  <BsPersonCircle color="white" />
                </li>
              </ul>
            </div>
            <div className="nav-right">
              <div className="search-box">
                <BsSearch color="white" />
                <input type="text" placeholder="Search through pings" />
                <div className="nav-user-icon">
                  <UserAvatar size="48" name="Jane Doe" color="#FFF" />
                </div>
              </div>
            </div>
          </nav>
        </body>
      </div>
    );
  }
}

export default MainPageComponent;
